		Vec4V testVect2( 0.5f, 2.1f, 6.0f, 6.0f );
		Vec4V testVect3( -0.1f, -2.0f, 4.0f, 5.0f );
		Vec4V testVect4( 0.5f, 1.9f, 6.0f, 6.0f );

		CHECK(	0 != IsBetweenNegAndPosBounds( testVect, testVect2 ) &&
			0 == IsBetweenNegAndPosBounds( testVect3, testVect4 ) );
