		Vec4V testVect7( V4VConstant(V_MASKZW) );

		CHECK(	0 != IsEqualIntAll( Vec4V(testVect3), Vec4V(V4VConstant(V_MASKXYZW)) ) &&
				0 != IsEqualIntAll( Vec4V(testVect6), testVect7 ) );
