		VEC4V_QA_ITEM_BEGIN( Vec4V_IsEqualIntV )
	{
		union
		{
			float f;
			int i;
		} Temp, Temp2;
		Temp.f = GetNaN();
		Temp2.f = GetNaN();
		Temp2.i++;

		Vec4V testVect( Temp.f, Temp.f, Temp.f, Temp.f );
		Vec4V testVect2( Temp.f, Temp.f, Temp.f, Temp.f );
		VecBoolV testVect3 = IsEqualInt( testVect, testVect2 );

		// NOTE: Temp2 differs in one bit from Temp. Here, we want to make sure that the whole component of the
		// result is zero'd, and not just the bit.
		Vec4V testVect4( Temp.f, Temp.f, Temp.f, Temp.f );
		Vec4V testVect5( Temp.f, Temp.f, Temp.f, Temp2.f );
		VecBoolV testVect6 = IsEqualInt( testVect4, testVect5 );

		// NOTE: Also works on floats.
		Vec4V testVect7( 1.0f, 2.0f, 3.0f, 4.0f );
		Vec4V testVect8( 1.0f, 2.0f, 3.2f, 4.0f );
		VecBoolV testVect9 = IsEqualInt( testVect7, testVect8 );
		CHECK(	0 != IsEqualIntAll( Vec4V(testVect3), Vec4V(V4VConstant(V_MASKXYZW)) ) &&
				0 != IsEqualIntAll( Vec4V(testVect6), Vec4V(V4VConstant(V_MASKXYZ)) ) &&
				0 != IsEqualIntAll( Vec4V(testVect9), Vec4V(V4VConstant(V_MASKXYW)) ) );
	}
